// codeFrequencySlice.js

import { createSlice } from '@reduxjs/toolkit';

const codeFrequencySlice = createSlice({
  name: 'codeFrequency',
  initialState: {
    data: [],
  },
  reducers: {
    setCodeFrequency: (state, action) => {
      state.data = action.payload;
    },
  },
});

export const { setCodeFrequency } = codeFrequencySlice.actions;
export default codeFrequencySlice.reducer;
